[ScoreHD] Angel Wicky (Angel &amp; The Bad Men / 11.28.2013)

Stacked like a library bookshelf and blessed with a beautiful face, newcomer Angel Wicky is showing two dudes a painting she wants to sell them. What they really want is to dip their paint brushes in art dealer Angel's palette. Angel must have a great sales history, judging by how she leans over one of the guys sitting on the couch and practically lap dances him when she points out a feature of the painting.

